import React from 'react'

class SearchBar extends React.Component{

    render(){
        return(
            <div className="row">
                <div className="col-md-6 col-md-offset-3">
                <div className="input-group">
                <input className="form-control input-lg" />
                
                </div>
            </div>
            </div>
        );
    }
}

export default SearchBar;
